import React from 'react';
import PropTypes from 'prop-types';

const Header = props => {
  defaultProps = {
    branding: 'My App'
  };
  const { branding } = props;
  return (
    <div>
      <h1>{branding}</h1>
    </div>
  );
};

Header.defaultProps = {
  branding: 'My App'
};

Header.propTypes = {
  branding: PropTypes.string.isRequired
};

export default Header;
